const Reducers = (initialState = '', action) => {
  switch (action.type) {
    case "men's clothing":
      return "men";

    case "jewelery":
      return "jewelery";
    case "electronics":
      return "electronics";
    case "women's clothing":
      return "women's clothing";
  }
};
export default Reducers;
